import React from "react";

const Header = () => {
  return (
    <>
      <div style={{ backgroundColor: "lightGrey", height: 300 }}>
        <div className="container">
          <h2>Page Name</h2>
        </div>
      </div>
    </>
  );
};

export default Header;
